import React from 'react';
import Header from "./components/Layout/Header";
import Tires from './components/Tires/Tires';
import Cart from './components/Cart/Cart';
import data from './data.json';

function App() {
  return (
    <React.Fragment>
      <Cart data={data}/>
      <Header />
      <main>
        <Tires />
      </main>
    </React.Fragment>
  );
}

export default App;
